import React from 'react';
import useAudioPlayer from "./useAudioPlayer";

const MusicPlayer = () => {
  const { play } = useAudioPlayer();
  return (
    <>
      <button onClick={play()}>Play</button>
      <progress value={50} max={100} />
    </>
  );
};

export default MusicPlayer;
